```mongodb
db.encounters.aggregate([
    {
        $match: {
            "SUPPLIES.NAME": "CPAP/BPAP oral mask"
        }
    },
    {
        $unwind: "$SUPPLIES"
    },
    {
        $project: {
            _id: 0,
            ENCOUNTER_ID: "$ENCOUNTER_ID",
            SUPPLY_NAME: "$SUPPLIES.NAME"
        }
    },
    {
        $group: {
            _id: "$ENCOUNTER_ID",
            SUPPLY_NAME: { $addToSet: "$SUPPLY_NAME" }
        }
    },
    {
        $project: {
            _id: 0,
            ENCOUNTER_ID: "$_id",
            "Associated Supplies": "$SUPPLY_NAME"
        }
    }
])
```

