```
db.prescriptions.aggregate([
    {
        $match: {
            "MEDICATIONS": {
                $elemMatch: {
                    "NAME": "Acetaminophen 300 MG / Hydrocodone Bitartrate 5 MG Oral Tablet"
                }
            }
        }
    },
    {
        $unwind: "$MEDICATIONS"
    },
    {
        $unwind: "$MEDICATIONS.PAYERS"
    },
    {
        $group: {
            _id: "$MEDICATIONS.PAYERS",
            count: { $sum: 1 }
        }
    },
    {
        $sort: { count: -1 }
    },
    {
        $limit: 1
    }
])
```

```
db.customers.aggregate([
    {
        $match: {
            "PAYERS.PAYER_ID": "d18ef2e6-ef40-324c-be54-34a5ee865625"
        }
    },
    {
        $unwind: "$PAYERS"
    },
    {
        $lookup: {
            from: "quality_of_life_scores",
            localField: "PAYERS.CUSTOMER_ID",
            foreignField: "CUSTOMER_ID",
            as: "quality_scores"
        }
    },
    {
        $unwind: "$quality_scores"
    },
    {
        $group: {
            _id: "$quality_scores.CUSTOMER_ID",
            avgQuality: { $avg: "$quality_scores.SCORE" }
        }
    },
    {
        $project: {
            _id: 0,
            averageQuality: "$avgQuality"
        }
    }
])
```
